function Gallery(props) {
  const styles = {
    wrapper: {
      backgroundColor: '#EBD7C1',
      padding: '50px',
      color: '#462920'
    },
    about: {
      width: '500px',
      margin: '0 auto',
      textAlign: 'center'
    },
    // contact: {
    //   display: 'flex',
    //   flexDirection: 'column',
    // },
    sides: {
      display: 'flex',
      justifyContent: 'space-between',
      flexWrap: 'no-wrap',
    }
  }

    return (
      <main>

        <h1>About Me</h1>

        <div className="wrapper" style={styles.wrapper}>

          <p style={styles.about}>I'm a marketing professional with a passion for design and background in graphic design, marketing strategy, paid social advertising and E-Commerce. I've recently decided to make a career s</p>

          <div className="sides">
            <section>
              <ul>
                <h3>Skills</h3>
                <li>HTML5</li>
                <li>CSS</li>
                <li>Javascript</li>
                <li>JQuery</li>
                <li>Bootstrap</li>
                <li>moment.js</li>
                <li>React</li>
                <li>Node.js</li>
              </ul>
            </section>

            <aside style={styles.contact}>
              <h3>CONTACT</h3>
              <a>GitHub</a>
              <a>LinkedIn</a>
              <a href="mailto:tamzin.chikhalia@gmail.com">Email</a>
              <a>CV</a>
            </aside>
          </div>
        </div>

      </main>
    )
  }

  export default Gallery;

  /* Add:
   - Skills
   - Languages/key concepts
   - linkedin
   - github
   - CV
   - my email
   - brief summary of projects */
